<script setup>

import CheckAccount from '@/Layouts/CheckAccount.vue';
import "bootstrap/dist/css/bootstrap.min.css";
import { ref, onMounted, watch, computed } from 'vue'

const theme = ref(getPreferredTheme())

function getStoredTheme() {
  return localStorage.getItem('theme')
}

function setStoredTheme(newTheme) {
  localStorage.setItem('theme', newTheme)
}

function getPreferredTheme() {
  const storedTheme = getStoredTheme()
  if (storedTheme) {
    return storedTheme
  }
  return window.matchMedia('(prefers-color-scheme: dark)').matches ? 'dark' : 'light'
}

function setTheme(newTheme) {
  theme.value = newTheme
  if (newTheme === 'auto') {
    document.documentElement.setAttribute('data-bs-theme', 
      window.matchMedia('(prefers-color-scheme: dark)').matches ? 'dark' : 'light'
    )
  } else {
    document.documentElement.setAttribute('data-bs-theme', newTheme)
  }
}

const currentTheme = computed(() => {
  if (theme.value === 'auto') {
    return window.matchMedia('(prefers-color-scheme: dark)').matches ? 'dark' : 'light'
  }
  return theme.value
})

const themeIcon = computed(() => {
  switch(theme.value) {
    case 'light':
      return 'bi bi-sun-fill theme-icon-active'
    case 'dark':
      return 'bi bi-moon-stars-fill theme-icon-active'
    default:
      return 'bi bi-circle-half theme-icon-active'
  }
})

function toggleTheme() {
  const themes = ['light', 'dark', 'auto']
  const currentIndex = themes.indexOf(theme.value)
  const newTheme = themes[(currentIndex + 1) % themes.length]
  setStoredTheme(newTheme)
  setTheme(newTheme)
}

onMounted(() => {
  setTheme(getPreferredTheme())
  
  window.matchMedia('(prefers-color-scheme: dark)').addEventListener('change', () => {
    const storedTheme = getStoredTheme()
    if (storedTheme !== 'light' && storedTheme !== 'dark') {
      setTheme(getPreferredTheme())
    }
  })
})

watch(theme, (newTheme) => {
  setStoredTheme(newTheme)
})

</script>

